import GameBoard from "./GameBoard";

const generateLines = () => {

    const numberOfRows = 10;

    let rows = new Array(numberOfRows);
    rows.forEach(row => {
        rows.push = { column: 1 };
    });

    return rows;
    // return [{}, {}, {}];
};

export default function Game() {
    return (
        <GameBoard word="anagramida" lines={generateLines()} />
    );
}
